const input = $input.first().json;

// Hash is calculated by previous node
const hash = input.content_hash;

const fileType = (input.mime_type || '').includes('pdf') ? 'pdf' : (input.mime_type || '').includes('word') ? 'docx' : 'txt';

return [{
  json: {
    user_id: input.user_id,
    filename: input.filename,
    file_type: fileType,
    mime_type: input.mime_type,
    content_hash: hash,
    base64: input.document_base64,
    user_message: input.user_message
  }
}];

const fileInfo = $('Extract Info').first().json;
const docs = $input.all();
const uploadedHash = fileInfo.content_hash;
const uploadedUserId = fileInfo.user_id;

// Check for duplicate by content_hash
let isDuplicate = false;
let existingId = null;
let nextVersion = 1;
let parentId = null;

for (const doc of docs) {
  const d = doc.json;
  if (d && d.user_id === uploadedUserId) {
    // Check duplicate
    if (d.content_hash === uploadedHash) {
      isDuplicate = true;
      existingId = d.id;
      break;
    }
    // Check version (same filename)
    const existingBase = (d.filename || '').replace(/\.[^.]+$/, '').toLowerCase();
    const uploadBase = (fileInfo.filename || '').replace(/\.[^.]+$/, '').toLowerCase();
    if (existingBase === uploadBase) {
      const ver = d.version || 1;
      if (ver >= nextVersion) {
        nextVersion = ver + 1;
        parentId = d.parent_id || d.id;
      }
    }
  }
}

if (isDuplicate) {
  return [{
    json: {
      ...fileInfo,
      is_duplicate: true,
      existing_id: existingId,
      response: 'This document has already been uploaded. No action needed.'
    }
  }];
}

return [{
  json: {
    ...fileInfo,
    is_duplicate: false,
    version: nextVersion,
    parent_id: parentId
  }
}];

const response = $input.first().json;
const fileInfo = $('Check Duplicate Logic').first().json;

const fullText = response.candidates?.[0]?.content?.parts?.[0]?.text || '';
if (!fullText) {
  return [{ json: { ...fileInfo, error: 'Could not extract text', success: false, response: 'Failed to extract text from document.' } }];
}

// Chunking
const CHUNK_SIZE = 2000;
const OVERLAP = 200;
const chunks = [];

for (let i = 0; i < fullText.length; i += (CHUNK_SIZE - OVERLAP)) {
  const chunk = fullText.slice(i, i + CHUNK_SIZE).trim();
  if (chunk) {
    chunks.push({
      user_id: fileInfo.user_id,
      filename: fileInfo.filename,
      content: chunk,
      chunk_index: chunks.length
    });
  }
}

return [{
  json: {
    ...fileInfo,
    full_text: fullText,
    summary: fullText.slice(0, 500) + '...',
    total_chunks: chunks.length,
    chunks: chunks
  }
}];

const docResult = $input.first().json;
const prevData = $('Chunk Text').first().json;
const documentId = docResult.id;
const chunks = prevData.chunks || [];

return chunks.map((chunk, i) => ({
  json: {
    ...chunk,
    document_id: documentId,
    chunk_index: i
  }
}));

const chunkData = $("Chunk Text").first().json;
const summary = $("Summarize Chain").first().json.text;
const docId = $("Save Document").first().json.id;

return [{
  json: {
    success: true,
    response: summary + "\n\n(Indexed " + chunkData.total_chunks + " chunks)",
    document_id: docId,
    version: chunkData.version,
    summary: summary
  }
}];

const data = $input.first().json;
return [{
  json: {
    success: true,
    response: data.response || 'This document has already been uploaded.',
    is_duplicate: true
  }
}];

return [{
  json: {
    success: false,
    response: "I cannot check document details because no document was found in this request. Please upload the document again."
  }
}];

